import React from 'react';

const Index = (props) => {
    return (
        <>
            <div className={props.className} >
                <span className={props.spanclass}>{props.link}</span>
                <h2>{ props.title }</h2>
                <p>{ props.subTitle }</p>
            </div>
        </>
    );
}

export default Index;
